values:
Mga ka-PoT: 

Due to my LONG vacation at problema sa pag-aaral, paumanhin kung napakatagal bago ko pa nai-update itong kawawang journal. Ngunit ito ang masaya: AKO AY NAGBALIK! At tulad ng aking ipinangako, itutuloy na natin ang ating fanfiction! Subalit para di naman magmukhang bitin ang istorya, naisip kong simulan ulet ang kuwento sa SIMULA, he-he, pero wala namang na-revised. Ito pa rin 'yon, nilipat ko lang sa mas&nbsp;convenient na lugar, pagkatapos ng pagpapakilala sa ating mga bayani ng Seigaku Jr. High. 

Para malinis, nasa susunod na entry ang simula ng fanfic.&nbsp;Just click on the green arrow keys to the right para sunud-sunod na ang pagbabasa ninyo. Getch? Good! Sige, mga pashnea, kita na lang tayo sa susunod na entry! PEACE!&nbsp;
